    const violinChart = (c1, c2, id, clear) => {
        d3.select(`#${selectorPrefix}-title${id}`)
            .text(`Compare Countries`);
        const h = 600;
        const chart = d3.select(`#${selectorPrefix}-chart${id}`)
            .attr(`height`, h);
        if (clear) {
            chart.selectAll(`*`).remove();
        }
        const compare = [c1, c2];
        chart.selectAll(`.${selectorPrefix}-violin-axis`).remove();
        chart.selectAll(`${selectorPrefix}-violin-marker`).remove();

        const x = d3.scaleBand()
            .range([5, width - 5])
            .domain(compare)
            .padding(0.05)
        chart.append(`g`)
            .attr(`transform`, `translate(0,${height - 25})`)
            .attr(`class`, `${selectorPrefix}-violin-axis`)
            .style(`color`, c_dark_text)
            .call(d3.axisBottom(x))

        const data = compare.map(c => processedData.map(d => ({
            col: c,
            pct: diff(d, c)
        }))).flat();
        const bound = d3.max(d3.extent(data.map(d => d.pct)).map(x => Math.abs(x)));
        const y = d3.scaleLinear()
            .domain([-bound, bound])
            .range([height - 25, 25])
        chart.append(`g`).call(d3.axisLeft(y))
            .style(`color`, c_dark_text)
            .attr(`class`, `${selectorPrefix}-violin-axis`)
            .attr(`transform`, `translate(25,0)`);
        const histogram = d3.histogram()
            .domain(y.domain())
            .thresholds(y.ticks(20))
            .value(d => d)
        const sumstat = d3.rollup(data, d => {
            const input = d.map(g => g.pct)
            return histogram(input);
        }, d => d.col);
        var maxNum = 0;
        for (const [_, allBins] of sumstat) {
            const lengths = allBins.map(d => d.length);
            const maxLen = d3.max(lengths);
            maxNum = Math.max(maxNum, maxLen);
        }
        const xNum = d3.scaleLinear()
            .range([0, x.bandwidth()])
            .domain([-maxNum, maxNum]);
        chart
            .selectAll(`.${selectorPrefix}-violin`)
            .data(sumstat)
            .join(
                enter => enter.append(`path`)
                .attr(`transform`, d => {
                    return `translate(${x(d[0])},0)`;
                })
                .datum(d => d[1])
                .attr(`class`, `${selectorPrefix}-violin`)
                .style(`stroke`, c_border)
                .style(`fill`, c_light)
                .attr(`d`, d3.area()
                    .x0(d => xNum(-d.length))
                    .x1(d => xNum(d.length))
                    .y(d => y(d.x0))
                    .curve(d3.curveCatmullRom)
                ),
                update => update.attr(`transform`, d => {
                    return `translate(${x(d[0])},0)`;
                })
                .datum(d => d[1])
                .transition().duration(AT)
                .attr(`d`, d3.area()
                    .x0(d => xNum(-d.length))
                    .x1(d => xNum(d.length))
                    .y(d => y(d.x0))
                    .curve(d3.curveCatmullRom)
                )
            );
        chart.append(`line`)
            .attr(`class`, `${selectorPrefix}-violin-marker`)
            .attr(`x1`, 25)
            .attr(`x2`, width - 25)
            .attr(`y1`, y(0))
            .attr(`y2`, y(0))
            .attr(`stroke`, c_border);
        chart.append(`text`)
            .attr(`class`, `${selectorPrefix}-violin-marker`)
            .attr(`x`, 30)
            .attr(`y`, y(0) - 5)
            .text(`More Yes Responses Than Average`)
            .attr(`fill`, c_dark_text);
        chart.append(`text`)
            .attr(`class`, `${selectorPrefix}-violin-marker`)
            .attr(`x`, 30)
            .attr(`y`, y(0) + 25)
            .text(`Fewer Yes Responses Than Average`)
            .attr(`fill`, c_dark_text);
    }

